// src/ImageGallery.jsx
import React from "react";
import images from "./data"; // Import image data (if used)

const ImageGallery = () => {
  return (
    <div className="image-gallery">
      {/* Map over images and render each image */}
      {images.map((image) => (
        <img
          key={image.src} // Unique key for each image
          src={image.src}
          alt={image.alt}
          className="gallery-image"
          onMouseEnter={() => console.log("Hovered over image:", image.title)} // Handle hover event (placeholder)
        />
      ))}
    </div>
  );
};

export default ImageGallery;
